import React, { useEffect, useState } from 'react';

const SignInCreateAccount = () => {
  const [isSigningIn, setIsSigningIn] = useState(true);
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [confirmPassword, setConfirmPassword] = useState('');

  // For accounts data
  const [accounts, setAccounts] = useState([]);

  useEffect(() => {
    fetch('http://localhost:8000/api/accounts/')
      .then((response) => response.json())
      .then((data) => setAccounts(data))
      .catch((error) => console.error('Error:', error));
  }, []);

  // Handle Sign In form submission
  const handleSignIn = (e) => {
    e.preventDefault();
    console.log('Signing in with:', email, password);
  };

  // Handle Create Account form submission
  const handleCreateAccount = (e) => {
    e.preventDefault();
    if (password !== confirmPassword) {
      alert("Passwords don't match!");
      return;
    }
    console.log('Creating account with:', email, password);
  };

  return (
    <div style={styles.container}>
      <div style={styles.toggleContainer}>
        <button
          style={isSigningIn ? styles.activeToggle : styles.toggleButton}
          onClick={() => setIsSigningIn(true)}
        >
          Sign In
        </button>
        <button
          style={!isSigningIn ? styles.activeToggle : styles.toggleButton}
          onClick={() => setIsSigningIn(false)}
        >
          Create Account
        </button>
      </div>

      {isSigningIn ? (
        <form onSubmit={handleSignIn} style={styles.form}>
          <h1>Sign In</h1>
          <input
            type="email"
            placeholder="Email"
            value={email}
            onChange={(e) => setEmail(e.target.value)}
            required
            style={styles.input}
          />
          <input
            type="password"
            placeholder="Password"
            value={password}
            onChange={(e) => setPassword(e.target.value)}
            required
            style={styles.input}
          />
          <button type="submit" style={styles.button}>Sign In</button>
        </form>
      ) : (
        <form onSubmit={handleCreateAccount} style={styles.form}>
          <h1>Create Account</h1>
          <input
            type="email"
            placeholder="Email"
            value={email}
            onChange={(e) => setEmail(e.target.value)}
            required
            style={styles.input}
          />
          <input
            type="password"
            placeholder="Password"
            value={password}
            onChange={(e) => setPassword(e.target.value)}
            required
            style={styles.input}
          />
          <input
            type="password"
            placeholder="Confirm Password"
            value={confirmPassword}
            onChange={(e) => setConfirmPassword(e.target.value)}
            required
            style={styles.input}
          />
          <button type="submit" style={styles.button}>Create Account</button>
        </form>
      )}

      <div>
        <h1>Accounts</h1>
        <ul>
          {accounts.map((account) => (
            <li key={account.id}>{account.username}</li> // Adjust to your actual account model fields
          ))}
        </ul>
      </div>
    </div>
  );
};

const styles = {
  container: { maxWidth: '400px', margin: '0 auto', padding: '20px', textAlign: 'center' },
  toggleContainer: { display: 'flex', justifyContent: 'center', marginBottom: '20px' },
  toggleButton: { padding: '10px 20px', fontSize: '16px', border: '1px solid #ccc', cursor: 'pointer', backgroundColor: '#f0f0f0', margin: '0 5px' },
  activeToggle: { padding: '10px 20px', fontSize: '16px', border: '1px solid #4CAF50', cursor: 'pointer', backgroundColor: '#4CAF50', color: 'white', margin: '0 5px' },
  form: { display: 'flex', flexDirection: 'column' },
  input: { margin: '10px 0', padding: '10px', fontSize: '16px', border: '1px solid #ccc' },
  button: { padding: '10px', backgroundColor: '#4CAF50', color: '#fff', border: 'none', cursor: 'pointer' },
};

export default SignInCreateAccount;
